def solution(l):
    l.sort()
    # print(l)
    count = 0
    for i in range(len(l)): 
        for j in range(i+1, len(l)): 
            for k in range (j+1, len(l)):
                if l[j] % l[i] == 0 and l[k] % l[j] == 0:
                    count += 1
    return count


